import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import sdata from "./Sdata";
import './index.css';



ReactDOM.render(
  <>
    {sdata.map(function cval(val) {
      return (
        <Card
          name={val.name}
          imgsrc={val.imgsrc}
          title={val.title}
          link={val.link}
        />
      );
    })}
  </>,
  document.getElementById("root")
);
